39.body:
Sometimes I write my Sass based on the problems a group of rules are intended to solve. For e.g. I might rewrite the Sass above in the following way: @use "../colors";
@use "../typography"; // Block .display { padding: 5px 5px 10px 5px; font-family: typography.$digital; text-align: right; background-color: colors.$black;
} // Elements .display__line1 { padding-bottom: 2px; font-size: 1.25rem; color: colors.$orange;
} .display__line2 { font-size: 1.875rem; color: colors.$white;
} // Deal with the empty state .display__line1:empty::before,
.display__line2:empty::before { content: "\00A0";
} // Deal with long text .display { overflow-wrap: break-word;
} .display__line1, .display__line2 { line-height: 1;
}

