The .page block and .page__content element both make use of general layout patterns that I made reusable with mixins . @mixin centered-column($gap) { display: flex; flex-direction: column; align-items: center; gap: $gap;
} @mixin absolute-center($padding, $height: 100vh) { display: flex; height: $height; &__wrapper { padding: $padding; // // Ensures the padding is shown when the content overflows its container. // display: inline-block; // // Vertically and horizontally center. // margin: auto; }
} Here's the CSS that's generated: .page { display: flex; height: 100vh;
} .page__wrapper { padding: 20px; display: inline-block; margin: auto;
} .page__content { display: flex; flex-direction: column; align-items: center; gap: 15px;
}
